import React from 'react';
import './Header.css';

function Header() {
  return (
    <header className="bg-white shadow-md">
      <nav className="container mx-auto px-6 py-3">
        <ul className="flex space-x-4">
          <li>
            <a href="#" className="text-gray-800 hover:text-gray-600">
              Home
            </a>
          </li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
